Relationship.create([subject_id: (Resource.find_by literal: 'T0000211').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "用于受害国在其港口拘押敌国船舶以实施报复。对违反国际法国家实施经济、外交和其他制裁手段，用\"制裁\"或更具体的叙词，如\"武器禁运\"。", language_id: (Language.find_by name: 'zh').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0000211').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "Use with respect to detention of an enemy State's ships in the port of an injured State by way of reprisal.  For economic, diplomatic and other measures taken against States violating international law, use SANCTIONS or more specific term, e.g., ARMS EMBARGO", language_id: (Language.find_by name: 'en').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0000211').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "Défense faite par un Etat de laisser partir les navires étrangers mouillés dans ses ports. Pour les mesures économiques ou diplomatiques à l'encontre des Etats violant le droit international, employer SANCTIONS ou des descripteurs plus précis, tels que EMBARGO SUR LES ARMES", language_id: (Language.find_by name: 'fr').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0000211').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "Относится к задержанию судов неприятельского государства в порту пострадавшего государства в качестве репрессалии.  Применительно к экономическим, дипломатическим и прочим мерам, принимаемым против государств, нарушающих международное право, пользоваться рубрикой \"Санкции\" или более узкой рубрикой, например \"Эмбарго на поставки оружия\"", language_id: (Language.find_by name: 'ru').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0000211').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "Usese con respecto a la detención de los buques de un Estado enemigo en el puerto del Estado afectado como medida de represalia. Para medidas económicas, diplomáticas o de otra naturaleza tomadas en contra de Estados que violan el derecho internacional, úsese SANCIONES o un término más específico, por ejemplo, EMBARGO DE ARMAS", language_id: (Language.find_by name: 'es').id).id])
